import React from 'react';
import { BrowserRouter as Router, Route, Redirect, Switch } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import Ss7 from './game/ss7/Ss7';

const App = () => {
  return (

    <Router>
      <Switch>
        <Route path="/game/ss7" exact>
          <div className="App">
            <header className="App-header">
              <div className="skore"><span className="logo_skore" id="sk">sk</span><img src={logo} className="App-logo" alt="logo" /><span className="logo_skore" id="re">re</span></div>
            </header>
          </div>
          <Ss7 />
        </Route>

        <Route path="/" exact>
          <div className="App">
            <header className="App-header">
              <div className="skore"><span className="logo_skore" id="sk">sk</span><img src={logo} className="App-logo" alt="logo" /><span className="logo_skore" id="re">re</span></div>   
              <code>Long Live Mark</code>
            </header>
            {/* make this lets begin the entry point for the no of players input */}
            <h3 className='skore_title'> Select the game for today</h3>
            <ul className="players_list">
              <li>Secret Suka 7</li>
              <li>Points</li>
              <li>idk yet</li>
              {/* i am mentally tired today but good days work i guess */}
              {/* li click redirect to the /game/route idk how yet */}
            </ul>
          </div>
        </Route>

        <Redirect to='/' />
      </Switch>

    </Router>

  );
}

export default App;
